MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "Rule-based OPC performs optical corrections by moving target shape edges based on their lithographic impact.");
MGCAddSnippet(5, "Calibre RET solutions provide standard rule-based OPC, table-driven OPC, and model-based OPC. Calibre also provides a number of applications you can use for post-correction inspection. You may adopt one tool exclusively or mix and match tools as your process requires.");
MGCAddSnippet(6, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(7, "Adhering to systematic development methods result in accurate and consistent rule-based OPC recipes.");
MGCAddSnippet(8, "Classifying edges requiring correction is the first step to developing rule-based OPC. It can also serve as the first step in table-driven OPC and model-based OPC.");
MGCAddSnippet(9, "Edge selection can be performed incorrectly by selecting the same edge multiple times, selecting too many edges, and selecting edges to the side of a measurement region. Using metrics with dimension checks reduces incorrect edge selection.");
MGCAddSnippet(10, "Edges must be classified correctly to provide expected biasing results.");
MGCAddSnippet(11, "EXPAND EDGE and CORNER FILL provide quick and accurate biasing of convex and concave corners.");
MGCAddSnippet(12, "Combining correction and design data with layer operations requires that you store it in a usable form.");
MGCAddSnippet(13, "SVRF operations are required to implement rule-based OPC.");
MGCAddSnippet(14, "Vias and contacts are often biased with respect to their density. Two SVRF operations can be used to increase the size of an isolated via.");
MGCAddSnippet(15, "Hammerheads are generally applied at the end of target geometries. ");
MGCAddSnippet(16, "Table-Driven OPC (CalibreTDopc) consists of three SVRF operations, OPCBIAS, LITHO NMBIAS and OPCLINEEND.");
MGCAddSnippet(17, "Every table summarizes OPC rule practices. While practices may vary from one design or lithography style, many use the same table format. ");
MGCAddSnippet(18, "OPCLINEEND, OPCBIAS, and LITHO NMBIAS involve writing SVRF commands including a TDopc operation, then invoking Calibre to process that SVRF file.");
MGCAddSnippet(19, "OPCLINEEND performs biasing using width and height of line-ends (with no consideration for spacing violations) applied to the entire poly layer.");
MGCAddSnippet(20, "OPCBIAS applies bias based on space and widths. Biasing can be positive or negative, adding to or reducing the width of a target shape, respectively. ");
MGCAddSnippet(21, "Calibre nmBIAS applies bias based on space and widths. Biasing can be positive or negative, adding to or reducing the width of a target shape, respectively. Either rule or table mode may be used.");
MGCAddSnippet(22, "LITHO NMBIAS-based commands perform biasing by calling a LITHO FILE statement that contains a setlayer nmbias command.");
MGCAddSnippet(23, "Biases layers and calls setlayer nmbias.");
MGCAddSnippet(24, "Biases drawn layers.");
MGCAddSnippet(25, "Provides control and parameter specification for fragmentation and biasing operations.");
MGCAddSnippet(26, "LITHO NMBIAS uses Tcl Scripting Commands to perform biasing.");
MGCAddSnippet(27, "Biases edges using a rule- or table-based method.");
MGCAddSnippet(28, "Biases edges using a table-based format.");
MGCAddSnippet(29, "Enables curvilinear biasing in nmBIAS.");
MGCAddSnippet(30, "Smooths curved fragment portions of curvilinear geometries.");
MGCAddSnippet(31, "Tightens fragment bias displacement.");
MGCAddSnippet(32, "Moves fragments.");
MGCAddSnippet(33, "Smooths a subset of fragments towards a given reference.");
MGCAddSnippet(34, "Determines whether edge biasing is performed sequentially or in parallel between multiple BIASRULE or BIASSMOOTH commands.");
MGCAddSnippet(35, "Returns a set of locked fragments.");
MGCAddSnippet(36, "Fills notches in shapes of the designated layer.");
MGCAddSnippet(37, "Biases qualifying shapes around their center line.");
MGCAddSnippet(38, "Shifts via polygons on the biased layer by a specified distance away from the reference layer.");
MGCAddSnippet(39, "Upsizes via polygons on the bias layer to a specified area. ");
MGCAddSnippet(40, "BIASRULE requires input layers and permits tagging edges of input layers. ");
MGCAddSnippet(41, "Declares the mask number to bias.");
MGCAddSnippet(42, "Declares the name of an input layer to bias.");
MGCAddSnippet(43, "Declares the name of a reference layer used to perform biasing.");
MGCAddSnippet(44, "Declares the name of an enclosure layer used to qualify biasing.");
MGCAddSnippet(45, "Declares the name of an overlap layer used to qualify biasing.");
MGCAddSnippet(46, "Declares an annotated tagset containing the classification values for the col metric.");
MGCAddSnippet(47, "Declares the output tagset with annotated bias values.");
MGCAddSnippet(48, "Declares an annotated tagset containing the classification values for the row metric.");
MGCAddSnippet(49, "Declares the selector tagset.");
MGCAddSnippet(50, "Declares a name for a group of edge fragments.");
MGCAddSnippet(51, "Declares a name for a group of space-based edge fragments.");
MGCAddSnippet(52, "Declares a name for a group of width-based edge fragments.");
MGCAddSnippet(53, "BIASRULE uses keywords to control edge manipulation during biasing.");
MGCAddSnippet(54, "Enables 3D interpolation for -table mode.");
MGCAddSnippet(55, "Enables shielding to assist with space or width measurements.");
MGCAddSnippet(56, "Enables interpolate mode.");
MGCAddSnippet(57, "Ignores qualifying jog lengths during contiguous edge length summation.");
MGCAddSnippet(58, "Classifies edges by length for subsequent biasing application. Used only with -table method.");
MGCAddSnippet(59, "Locks fragments from subsequent table biasing.");
MGCAddSnippet(60, "Locks fragments globally from subsequent table biasing.");
MGCAddSnippet(61, "Removes 1 DBU jogs from BIASRULE output.");
MGCAddSnippet(62, "Overrides metrics to bias all classified width fragments in projection.");
MGCAddSnippet(63, "Considers length of space classifications to bias all classified width fragments in projection.");
MGCAddSnippet(64, "Selects a table of constraints within a BIASRULE table.");
MGCAddSnippet(65, "Determines distance perpendicular to fragments when computing sidespace or sidepitch metrics.");
MGCAddSnippet(66, "Determines the classification parameter when computing sidespace or sidepitch metrics.");
MGCAddSnippet(67, "Forces GROW_UNTIL_SPACE or GROW_UNTIL_WIDTH irrespective of edge blockage.");
MGCAddSnippet(68, "Forces measurement from unmoved fragments.");
MGCAddSnippet(69, "BIASRULE uses two methods to organize biasing commands and values.");
MGCAddSnippet(70, "Specifies the biasing of edges with a rule-based method per provided space and other ranges.");
MGCAddSnippet(71, "Specifies the biasing of edges with a table-based method per provided space and width ranges.");
MGCAddSnippet(72, "Smoothing is performed by incremental and then decremental passes.");
MGCAddSnippet(73, "The -rule and -table writing methods differ but provide identical biasing.");
MGCAddSnippet(74, "The OPCBIAS command performs edge biasing on target shapes.");
MGCAddSnippet(75, "Performs edge biasing on input target shapes.");
MGCAddSnippet(76, "The OPCBIAS command moves individual target shape edges by predefined amounts depending on target widths and spaces between target shapes. You can also define edge constraints by width and space. Most tables specify corrections as a function of these two ranges.");
MGCAddSnippet(77, "Before you convert a table of rules into OPCBIAS syntax, understand how to interpret the table data. Be sure you know how to translate the discrete table values for width and spacing into ranges of values and whether the rule reflects one- or two-edge movement.");
MGCAddSnippet(78, "Strict interpretation of rules by OPCBIAS during biasing may lead to shapes that are not manufacturable, requiring OPCBIAS to perform clean up tasks.");
MGCAddSnippet(79, "When OPCBIAS identifies a short edge and a neighbor it can merge, it calculates the bias to use for the result. OPCBIAS determines priority of bias by comparing all biases, and space and width categories.");
MGCAddSnippet(80, "The OPCBIAS command provides flexibility for various biasing applications.");
MGCAddSnippet(81, "The OPCLINEEND command performs variable line-end extension, including end extension and hammerhead creation. ");
MGCAddSnippet(82, "Biases line-ends of input target shapes.");
MGCAddSnippet(83, "You define line-end corrections in terms of line-end extension, serif extension, and serif depth.");
MGCAddSnippet(84, "Depending on your process and design constraints, you may use as many as three criterion to describe line-end treatment:");
MGCAddSnippet(85, "Default rules define corrections required for all line-ends, but Calibre OPCLINEEND avoids post-bias errors by checking for spacing violations after applying the default correction.");
MGCAddSnippet(86, "The OPCLINEEND command modifies the shape of line-ends. ");
MGCAddSnippet(87, "This section describes some planning thoughts and the sequence of steps to convert a table of values into valid OPCLINEEND syntax.");
MGCAddSnippet(88, "When the data you pass to OPCLINEEND contains notched or stair-step shaped line-ends, the default behavior ignores those line-ends. ");
MGCAddSnippet(89, "Best practices improve Calibre OPCBIAS results.");
MGCAddSnippet(90, "These are recommended settings to improve results produced by the OPCBIAS command. ");
MGCAddSnippet(91, "The Calibre nmDRC hierarchical engine is the foundation for all Calibre RET solutions, and runs all Calibre programs hierarchically.");
MGCAddSnippet(92, "Calibre nmDRC is a powerful layout design verification and correction tool that manipulates layer data and performs design and manufacturability rule checks quickly and efficiently. It serves as the starting point for all Calibre RET batch processes, coordinating data exchange between layout files and Calibre tools.");
MGCAddSnippet(93, "Calibre is invoked on the command line from any Linux terminal window for many Calibre RET solutions.");
MGCAddSnippet(94, "Each Calibre run saves results and status information.");
MGCAddSnippet(95, "Several types of Calibre data are output for user-examination.");
MGCAddSnippet(96, "The result of any SVRF operation is a stored collection of data.");
MGCAddSnippet(97, "The dimension check is a commonly used SVRF operation. ");
MGCAddSnippet(98, "An SVRF file is an ASCII text file comprising SVRF statements. It contains everything needed to read layout data, process layer data, and apply RET solutions.");
MGCAddSnippet(99, "The SVRF file has structure and syntax requirements.");
MGCAddSnippet(100, "The contents of an SVRF file are divided into statements and operations.");
MGCAddSnippet(101, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

